#burqueyogis #challenge day 3 #riogrande #mermaid #pose.  i knew i needed a prop for this pose, my hips are very tight.  iâ€™ve been working on them for years, and like @mysticjen333 would say the hips are the emotional junk drawer.  i didnâ€™t anticipate these feelings to come up as i prepped for this pose.  i have endured #betrayal, #grief, #sadness, #metoo as i fought off an attempted rape and then the next year, i was held up by #gunpoint. i started at mi vida after i left my sonâ€™s father, and then my father died a month later.  tharan my son and i went 5 days a week because they had childcare, and i needed to #heal.  hot yoga covered my tears as the pain & sweat dripped off my body.  my mat soaked up my sorrow.  from march 2014 to july 2014 t would go with me & by the time he started full days at school in july he didnâ€™t want to go, he wanted to go to the yoga #studio.  he would say â€œyooooogggaâ€ i would say sorry, baby you have to go to school, i will take you on the weekend with @shakti_shaman carmen. his first yoga teacher.  he was always happy to spent time with the @mividayoga #angels ms. heather, @mysticjen333  @daisylovebaby.  as i was going to take these pics he wanted to join in.  and so i honor my healing, thoughts, & feelings that were brought forth tonight.  i honor my process, i honor all my amazing #teachers. i love you all with all my #â¤ï¸. and i honor no longer feeling #ashamed for things i did not do, and i honor my #strength and #perseverance.  i honor my #authenticity because this is who i am!! i put on my #bellbottoms so i could have a #mermaidtail that would assist me as a #prop.  honored my sonâ€™s #love for #yoga as well.  the headband is from an #artist in #sanfrancisco i bought before i moved here to #nm.  tharan was fascinated with the #peacock #feathers.  daily hosts:@mialovesthis @jjlucero8 @desertgardenyogi 
